import React from 'react';

import './Info.css';

const info = ( props ) => {

    return (
        <div className="info-box">
            <img src={props.spriteUrl} alt="Sprite" />
            <ul>
                <li><span>#{props.number}</span><span>{props.name}</span></li>
                <li><span>Height: {props.height} m</span><span>Weight: {props.weight} kg</span></li>
                <li>Types: </li>
            </ul>
        </div>
    )
};

export default info;
